import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          New text here :)
        </p>
        <a
          className="App-link"
          href="http://localhost:8081/api/getall"
          target="_blank"
          rel="noopener noreferrer"
        >
         http://localhost:8081/api/getall
        </a>
        <p>
          The button below will connect you to the node.js server 
        </p>
        <form action="../../api/getall" method="post" 
              className="form">
          <button type="submit">Connect to Node.js</button>
        </form>

        const [results, setResults] = useState([])

const GetMovieData = () => {
  fetch("http://localhost:8081/api/getall")
    .then((results) => {
      return results.json();
    })
    .then((data) => {
      console.log(data);
      const items = data;

      setResults(items)
    })};
};

      </header>
    </div>
  );
}

export default App;
